import React from 'react';

const FuniroFurnitureGallery = () => {
 
  const imageUrls = [
    '/Rectangle 36.png',
    '/Rectangle 37.png',
    '/Rectangle 38.png',
    '/Rectangle 39.png',
    '/Rectangle 40.png',
    '/Rectangle 41.png',
    '/Rectangle 43.png',
    '/Rectangle 44.png',
    '/Rectangle 45.png',
  ];

  return (
    <div className="funiro-furniture-gallery">
      <h2 style={{ textAlign: 'center', marginTop: '20px' }}>Share your setup with #FuniroFurniture</h2>
      <div className="gallery" style={{ display: 'flex', justifyContent: 'center', alignItems: 'flex-start' }}>
        {imageUrls.map((imageUrl, index) => (
          <img
            key={index}
            src={imageUrl}
            alt={`Funiro Furniture ${index + 1}`}
            style={{
              width: `${Math.floor(Math.random() * (300 - 200) + 200)}px`, // Random width between 200px and 300px
              height: 'auto', // Maintain aspect ratio
              margin: '10px', // Add margin between images
            }}
          />
        ))}
      </div>
    </div>
  );
};

export default FuniroFurnitureGallery;
